\begin{eqnarray*}
 &\dfrac{\mathrm{d} N}{\mathrm{d}t} = -\lambda N \\[10pt]
 &\dfrac{\mathrm{d} N}{N} = -\lambda \mathrm{d}t \\[10pt]
 &\displaystyle \int \dfrac{\mathrm{d} N}{N} = -\lambda \displaystyle \int \mathrm{d}t \\[10pt]
 &\ln N = -\lambda t + C \\[10pt]
 & N(t) = e^C e^{-\lambda t} = N_0 e^{-\lambda t}
\end{eqnarray*}
